import { PatientProvider } from "./PatientContext";
import { DoctorProvider } from "./DoctorContext";
import { PredictProvider } from "./PredictContext";

const ContextWrapper = ({children}) => {
    return (
        <PatientProvider>
            <DoctorProvider>
                <PredictProvider>
                    {children}
                </PredictProvider>
            </DoctorProvider>
        </PatientProvider>
    )
}

export default ContextWrapper;
